import React, {Component} from 'react';

class Choice extends Component{

    constructor(props){
        super(props);
        this.fname = "./static/choices/" + props.cname;
    }

    options = [
        <option>選択肢1</option>,
        <option>選択肢2</option>,
        <option>選択肢3</option>
    ];

    render(){
        return (
            <select>
                {this.options}
            </select>
        );
    }
}
export default Choice;
